JavaScript's built-in sorting function is case-insensitive by default. However, you can create a custom sorting function to make it case-sensitive. Here's an example:

```javascript
let arr = ['Apple', 'banana', 'Cherry', 'avocado'];

arr.sort((a, b) => {
  if (a.toLowerCase() < b.toLowerCase()) return -1;
  if (a.toLowerCase() > b.toLowerCase()) return 1;
  return 0;
});

console.log(arr); // ['Apple', 'avocado', 'banana', 'Cherry']
```

In this example, the sorting function compares the lowercase versions of the strings to ensure that the sorting is case-insensitive. However, the original strings are returned in the sorted array, preserving their original case.

If you want a case-sensitive sort, you can simply remove the `toLowerCase()` method:

```javascript
let arr = ['Apple', 'banana', 'Cherry', 'avocado'];

arr.sort((a, b) => {
  if (a < b) return -1;
  if (a > b) return 1;
  return 0;
});

console.log(arr); // ['Apple', 'Cherry', 'avocado', 'banana']
```

