To create a tooltip in NextJS using React Context to close the previously opened tooltip, you can follow these steps:

1. Create a TooltipContext.js file to define the context and its provider.

```javascript
import React, { createContext, useState } from 'react';

export const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, closeTooltip, openTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};
```

2. Wrap your application with the `TooltipProvider` in the `_app.js` file.

```javascript
import '../styles/globals.css';
import { TooltipProvider } from '../components/TooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```

3. Create a Tooltip.js component that uses the context to open and close tooltips.

```javascript
import React, { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, closeTooltip, openTooltip } = useContext(TooltipContext);

  const handleMouseEnter = () => {
    openTooltip(id);
  };

  const handleMouseLeave = () => {
    closeTooltip();
  };

  return (
    <div
      onMouseEnter={handleMouseEnter}
      onMouseLeave={handleMouseLeave}
    >
      {children}
      {activeTooltip === id && (
        <div className="tooltip">
          {/* Tooltip content */}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

4. Use the `Tooltip` component in your application.

```javascript
import Tooltip from '../components/Tooltip';

const MyComponent = () => {
  return (
    <div>
      <Tooltip id="tooltip1">
        <span>Hover over me</span>
      </Tooltip>
      <Tooltip id="tooltip2">
        <span>Hover over me</span>
      </Tooltip>
    </div>
  );
};

export default MyComponent;
```

Now, when you hover over a tooltip, it will open, and when you hover over another tooltip, the previously opened tooltip will close.

