import React from 'react';
import PropTypes from 'prop-types';

const Layout = ({ children, variant }) => {
  const className = variant === 'full-width' ? 'w-full' : 'w-1/2 mx-auto';

  return <div className={className}>{children}</div>;
};

Layout.propTypes = {
  children: PropTypes.node.isRequired,
  variant: PropTypes.oneOf(['full-width', 'centered']),
};

Layout.defaultProps = {
  variant: 'centered',
};

export default Layout;
```

This component takes in a `children` prop, which is the content that will be rendered inside the layout. It also takes in a `variant` prop, which determines the width of the layout. If the variant is 'full-width', the layout will take up the full width of its parent container. If the variant is 'centered', the layout will be centered and take up half the width of its parent container.

The component uses the `className` prop to apply the appropriate Tailwind CSS classes based on the `variant` prop. If the variant is 'full-width', the `w-full` class is applied, which sets the width to 100%. If the variant is 'centered', the `w-1/2` and `mx-auto` classes are applied, which set the width to 50% and center the layout horizontally, respectively.

The component also uses PropTypes to define the expected types of the `children` and `variant` props. The `children` prop is required and must be a React node. The `variant` prop is optional and must be one of the following values: 'full-width' or 'centered'. If no `variant` prop is provided, the default value is 'centered'.

Here is an example of how the component can be used:

```jsx
import Layout from './Layout';

const App = () => (
  <Layout variant="full-width">
    <h1>Hello, world!</h1>
  </Layout>
);
```

