Here's an example of how you might write the `onSubmit` function for a form using React and Apollo Client for GraphQL:

```jsx
import React, { useState } from 'react';
import { useMutation } from '@apollo/client';
import { ADD_DATA } from './mutations'; // Import your mutation

const MyForm = () => {
  const [formState, setFormState] = useState({});
  const [addData, { data, loading, error }] = useMutation(ADD_DATA);

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      const { data } = await addData({ variables: { input: formState } });
      console.log('Data submitted successfully: ', data);
      // Handle successful submission, e.g., clear form or show a success message
    } catch (error) {
      console.error('Error submitting data: ', error);
      // Handle error, e.g., show an error message
    }
  };

  const onChange = (event) => {
    setFormState({
      ...formState,
      [event.target.name]: event.target.value,
    });
  };

  return (
    <form onSubmit={onSubmit}>
      {/* Your form fields go here */}
      <input name="field1" onChange={onChange} />
      <input name="field2" onChange={onChange} />
      <button type="submit">Submit</button>
    </form>
  );
};

export default MyForm;
```

In this example, we're using the `useMutation` hook from Apollo Client to execute the `ADD_DATA` mutation. The `onSubmit` function is called when the form is submitted, and it prevents the default form submission behavior with `event.preventDefault()`.

The form data is stored in the `formState` state variable, which is updated by the `onChange` function whenever a form field changes. When the form is submitted, the `addData` function is called with the `formState` as the input variables.

If the mutation is successful, the `data` returned from the mutation is logged to the console. If there's an error, it's caught and logged to the console. You can replace these console logs with your own error handling and success messages.

