To make the code run only once every 0.6 seconds, you can use a debouncing technique. Debouncing is a technique used to limit the rate at which a function can be called.

Here's how you can modify your code to achieve this:

```javascript
import { useEffect, useRef } from 'react';

function useDebounce(callback, delay) {
  const savedCallback = useRef();

  useEffect(() => {
    savedCallback.current = callback;
  }, [callback]);

  useEffect(() => {
    const handler = (...args) => {
      savedCallback.current(...args);
    };

    if (delay !== null) {
      let timer = setInterval(handler, delay);
      return () => clearInterval(timer);
    }
  }, [delay]);
}

// In your component
useEffect(() => {
  useDebounce(() => {
    tl.set($portfolioNext.current,{
      clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
    });
    tl.set($portfolioNext.current,{
      css:{backgroundImage:'url('+cursor.cursorImage+')'},
    });

    tl.to($portfolioCurrent.current,{
      clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      duration:.5,
    },'start');

    tl.to($portfolioNext.current,{
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      delay:.1,
      duration:.5,
    },'start');

    tl.set($portfolioCurrent.current,{
      clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
    });

    tl.set($portfolioCurrent.current,{
      css:{backgroundImage:'url('+cursor.cursorImage+')'},
    });
  }, 600);
},[cursor.cursorImage]);
```

In this code, `useDebounce` is a custom hook that takes a callback function and a delay as arguments. The callback function is only called after the delay has passed since the last time it was called. The `useDebounce` hook uses the `useRef` and `useEffect` hooks to store the callback function and set up the debouncing behavior.

