Here is a simple Golang application that implements a DNS server using the `miekg/dns` package. This server forwards all requests to Google's public DNS (8.8.8.8) and Cloudflare's public DNS (1.1.1.1), and stores the resolved IP addresses in a map.

```go
package main

import (
	"fmt"
	"log"
	"net"
	"sync"

	"github.com/miekg/dns"
)

var (
	ipsMutex sync.Mutex
	ipsMap   = make(map[string][]string)
)

func main() {
	dns.HandleFunc(".", handleRequest)

	server := &dns.Server{
		Addr: ":53",
		Net:  "udp",
	}

	err := server.ListenAndServe()
	if err != nil {
		log.Fatalf("Failed to start the server: %v", err)
	}
}

func handleRequest(w dns.ResponseWriter, r *dns.Msg) {
	m := new(dns.Msg)
	m.SetReply(r)

	for _, q := range r.Question {
		ip, found := resolveIP(q.Name)
		if !found {
			continue
		}

		a := new(dns.A)
		a.Hdr = dns.RR_Header{Name: q.Name, Rrtype: dns.TypeA, Class: dns.ClassINET, Ttl: 0}
		a.A = net.ParseIP(ip).To4()
		m.Answer = append(m.Answer, a)
	}

	w.WriteMsg(m)
}

func resolveIP(hostname string) (string, bool) {
	ipsMutex.Lock()
	defer ipsMutex.Unlock()

	if ips, found := ipsMap[hostname]; found {
		return ips[0], true
	}

	c := new(dns.Client)
	m := new(dns.Msg)
	m.SetQuestion(hostname+".", dns.TypeA)

	for _, server := range []string{"8.8.8.8:53", "1.1.1.1:53"} {
		in, _, err := c.Exchange(m, server)
		if err != nil {
			continue
		}

		for _, ans := range in.Answer {
			if a, ok := ans.(*dns.A);
